import React from 'react'

const Other = () => {
  return (
    <div className='d-flex text-center flex-column justify-content-center align-items-center' style={{ height: '100vh' }}>
        <h1 className='fw-bolder m-2'>404</h1>
        <h2 className='fw-bold m-2'>Page Not Found</h2>
        <p className='fw-bold m-2'>Sorry, the page you are looking for does not exist.</p>
    </div>
  )
}

export default Other
